import React, { Component } from 'react';
import { PayrollEmployeeList } from './PayrollEmployeeList';
import { PayrollEmployee } from './PayrollEmployee';

export class Layout extends Component {
  static displayName = Layout.name;

    // eslint-disable-next-line no-useless-constructor
  constructor (props) {
    super(props);
    this.state = {
      showlist: true,
    };
  }

  render (employeeList) {
    return (
      <div className="Maindiv">
        <div className={this.state.showlist ? null : "hidden"}>
          <PayrollEmployeeList></PayrollEmployeeList>
        </div>
        <div className={!this.state.showlist ? null : "hidden"}>
        <PayrollEmployee></PayrollEmployee>
        </div>
      </div>
    );
  }
}
